var PPICalculator=function(){var n=this;n.ScreenWidth=ko.observable(1080);n.ScreenHeight=ko.observable(1920);n.ScreenSize=ko.observable(5);n.ScreenPPI=ko.computed(function(){var t=n.ScreenWidth(),i=n.ScreenHeight(),r=n.ScreenSize(),u;return t>0&&i>0&&r>0?(u=Math.sqrt(t*t+i*i)/r,Math.round(u*100)/100):0})};